import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import News from '../News/News';
import Button from '@mui/material/Button';
import LatestNews from '../LatestNews/LatestNews';
import FinancialContent from '../FinancialContent/FinancialContent';
import BankingSuggestion from '../BankingSuggestions/BankingSuggestions';
import LoanAdvice from '../LoanAdvice/LoanAdvice';

const useStyles = makeStyles((theme) => ({
  sidebar: {
    backgroundColor: '#2c3e50',
    width: 200,
    padding: '20px 0',
  },
  sidebarListItem: {
    padding: '10px 20px',
    color: '#ecf0f1',
    cursor: 'pointer',
  },
  sidebarListItemIcon: {
    minWidth: '40px',
  },
}));

function Sidebar() {
  const classes = useStyles();

  return (
    <div className={classes.sidebar}>
      <List>
        <Link to="/">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <HomeIcon />
            </ListItemIcon>
            <ListItemText primary="Home" />
          </ListItem>
        </Link>
        <Link to="/latest-news">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <NewReleasesIcon />
            </ListItemIcon>
            <ListItemText primary="Latest News" />
          </ListItem>
        </Link>
        <Link to="/get-advise">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <SupervisedUserCircleIcon />
            </ListItemIcon>
            <ListItemText primary="Get Advise" />
          </ListItem>
        </Link>
        <Link to="/get-your-case">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <SupervisedUserCircleIcon />
            </ListItemIcon>
            <ListItemText primary="Get Your Case" />
          </ListItem>
        </Link>
        <Link to="/my-pay">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <MonetizationOnIcon />
            </ListItemIcon>
            <ListItemText primary="My Pay" />
          </ListItem>
        </Link>
        <Link to="/settings">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <SettingsIcon />
            </ListItemIcon>
            <ListItemText primary="Settings" />
          </ListItem>
        </Link>
        <Link to="/log-out">
          <ListItem className={classes.sidebarListItem}>
            <ListItemIcon className={classes.sidebarListItemIcon}>
              <ExitToAppIcon />
            </ListItemIcon>
            <ListItemText primary="Log Out" />
          </ListItem>
        </Link>
      </List>
    </div>
  );
}

export default Sidebar;
